  },

  {
    original: 'https://themellowyellowmedia.b-cdn.net/top%20ten/14.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/top%20ten/14.jpg',
  },

  {
    original: 'https://themellowyellowmedia.b-cdn.net/top%20ten/15.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/top%20ten/15.jpg',
  },


];

class Home extends React.Component { 

  constructor() {
    super();
    this.state = { 

    };

  }

  componentDidMount()
  {

  }




  render()
  {  
    return (
      <div className="pageContainer">
        <div>
          <center>
            <br></br>
            <img src='https://themellowyellowmedia.b-cdn.net/cover.png' className='logo'></img>
            <br></br>
            <br></br>
            <img src='https://themellowyellowmedia.b-cdn.net/thumbnail.png' className='cover'></img>
            <br></br>

            <div className='socialContainer'>



            <a href="https://music.apple.com/us/artist/zl-ster/1544086565" target="_blank"><img src="https://themellowyellowmedia.b-cdn.net/apple_music.png" className='social'></img></a>
              &nbsp;


              <a href="https://open.spotify.com/artist/5q70XbWzSCjlnxUstVSYzw" target="_blank"><img src="https://themellowyellowmedia.b-cdn.net/spotify.png" className='social'></img></a>


            </div>
            <br></br>

              <img src="https://themellowyellowmedia.b-cdn.net/cloud_man_2-min.png" className='floatingMan'></img>

            <br></br>
            <br></br>

            <div
              className="video"
              style={{
                position: "relative",
                paddingBottom: "56.25%" /* 16:9 */,
                paddingTop: 25,
                height: 0,

              }}
            >

                  <iframe
                    style={{
                      position: "absolute",
                      top: '50%',
                      left: '50%',
                      width: "80%",
                      height: "80%",
                      border: '.5em solid yellow',
                      alignSelf: 'center',

                      transform: 'translate(-50%, -50%)'
                    }}
                    src={`https://www.youtube.com/embed/ZNXhjrj7byY`}
                    frameBorder="0"
                  />


            </div>
          <br></br>
            <img src="https://themellowyellowmedia.b-cdn.net/meditate_2.png" className='asset'></img>
            <br></br>
            <br></br>
            <div style={{width: '80%'}}>
            <ImageGallery items={images} showFullscreenButton={false} showPlayButton={false} />
            </div>

          <br></br>
          <br></br>
          <div className='containBorderAsset'>
          <img src="https://themellowyellowmedia.b-cdn.net/mushrooms-min.png" className='borderAsset'></img>
          </div>
          <div
              className="video"
              style={{
                position: "relative",
                paddingBottom: "56.25%" /* 16:9 */,
                paddingTop: 25,
                height: 0,

              }}
            >

                  <iframe
                    style={{
                      position: "absolute",
                      top: '50%',
                      left: '50%',
                      width: "80%",
                      height: "80%",
                      border: '.5em solid yellow',
                      alignSelf: 'center',

                      transform: 'translate(-50%, -0%)'
                    }}
                    src={`https://www.youtube.com/embed/ZNXhjrj7byY`}
                    frameBorder="0"
                  />


            </div>
          <br></br>


          <div className='containBorderAsset2'>
          <img src="https://themellowyellowmedia.b-cdn.net/spaceship-min%202.png" className='borderAsset2'></img>
          </div>
          <div
              className="video"
              style={{
                position: "relative",
                paddingBottom: "56.25%" /* 16:9 */,
                paddingTop: 25,
                height: 0,
                marginBottom: '40%'

              }}
            >

                  <iframe
                    style={{
                      position: "absolute",
                      top: '50%',
                      left: '50%',
                      width: "80%",
                      height: "80%",
                      border: '.5em solid yellow',
                      alignSelf: 'center',

                      transform: 'translate(-50%, 20%)'
                    }}
                    src={`https://www.youtube.com/embed/ZNXhjrj7byY`}
                    frameBorder="0"
                  />


            </div>
            <br></br>
            <img src="https://themellowyellowmedia.b-cdn.net/max-min_2.png" className='floatingMan'></img>
            <br></br>
            <br></br>
            <p><b>sign up for updates</b></p>
            <input placeholder='slime' className='mailingList'></input>
            <p><b>submit</b></p>

            <div id="container">
            <div class="item">
              <img src="https://www.kirupa.com/images/orange.png" />
            </div>
            <div class="circle" style={{animationDelay: '0s'}}></div>
            {/*}
<div class="circle" style={{animationDelay: '-1s'}}></div>
                  <div class="circle" style={{animationDelay: '-.5s'}}></div>*/}
<div class="circle" style={{animationDelay: '-1s'}}></div>
<div class="circle" style={{animationDelay: '-2s'}}></div>
    </div>
          <div className='shows'>
          <h1 className='header'>SHOWS</h1>
          <h1 className='text'><b>03.10</b><br></br>THE MOORE AUDITORIUM<br></br><span className='subtext'><i>TALLAHASSEE</i></span></h1>
          <br></br>
          <br></br>
          <h1 className='text'><b>03.26</b><br></br>THE HIPPODROME THEATRE<br></br><span className='subtext'><i>GAINESVILLE</i></span></h1>
          <br></br>
          <br></br>
          <h1 className='text'><b>03.26</b><br></br>THE BARK<br></br><span className='subtext'><i>TALLAHASSEE</i></span></h1>
          <br></br>
          <br></br>
          <h1 className='text'><b>04.08</b><br></br>WARRIOR ON THE RIVER<br></br><span className='subtext'><i>TALLAHASSEE</i></span></h1>
          <br></br>
          <br></br>
          <h1 className='text'><b>04.26</b><br></br>THE BARK<br></br><span className='subtext'><i>TALLAHASSEE</i></span></h1>
          </div>
          <br></br>
          <br></br>
          <img src="https://themellowyellowmedia.b-cdn.net/cover_elements.png" className='asset'/>

          <div className='shows'>
            <br></br>
            <br></br>
            <center><h1 className='text'><span className='subtext'>created in<br></br></span>Tallahassee, FL</h1></center>

            <br></br>
            <br></br>
            <span className='right'><h1 className='text'><span className='subtext'>cover by<br></br></span><b>Selin Kilinc</b></h1></span>

            <span className='left'><h1 className='text'><span className='subtext'>cover by<br></br></span><b>Fruition Creative</b></h1></span>

            <span className='right'><h1 className='text'><span className='subtext'>film by<br></br></span><b>Diana Alvarez</b></h1></span>

            <span className='left'><h1 className='text'><span className='subtext'>mastered by<br></br></span><b>K.O.T.P. Recordings</b></h1></span>

            <span className='right'><h1 className='text'><span className='subtext'>videos by<br></br></span><b>Andrew Strickland</b></h1></span>

            <span className='left'><h1 className='text'><span className='subtext'>music video by<br></br></span><b>Dopamine Film</b></h1></span>

            <span className='right'><h1 className='text'><span className='subtext'>visualizers by<br></br></span><b>Tropadelic</b></h1></span>

            <span className='left'><h1 className='text'><span className='subtext'>performed by<br></br></span><b>zl!ster</b></h1></span>

           <h1 className='text' ><b style={{marginTop: '10em'}}>instagram</b></h1>
          </div>
          </center>
        </div>





    </div>

    )




  }
}
export default Home;
